function continuousSubarrays(nums: number[]): number {
  let total = 0;
  let left = 0;

  for (let right = 0; right < nums.length; right++) {
    for (let i = left; i <= right; i++) {
      if (Math.abs(nums[i] - nums[right]) > 2) {
        left = i + 1;
      }
    }
    total += right - left + 1;
  }

  return total;
};
